import React, { useState } from 'react';
import { Box, TextField, Typography, Button } from '@mui/material';
import FormComponent4 from '../BscNursing4YDCForms/FormComponent4';

const subjectsData = [
  {
    title: "BIOC 135 & NUTR 140 Applied Biochemistry and Applied Nutrition & Dietrics",
    credits: 5,
    maxIA: 25,
    maxSE: 75,
    marksIA: 20,
    marksSE: 22,
    percentage: "84%",
    grade: "A",
    gradePoint: 8,
    creditPoints: 40,
    result: "Pass",
  },
  {
    title: "N -F (1 & 2) 125 Nursing Foundation 1 & 2 incl. Health Assessment Module-Theory",
    credits: 12,
    maxIA: 25,
    maxSE: 75,
    marksIA: 20,
    marksSE: 22,
    percentage: "84%",
    grade: "A",
    gradePoint: 8,
    creditPoints: 96,
    result: "Pass",
  },
  {
    title: "N-NF (1 & 2 )125  Nursing Foundation 1 & 2 incl. Health Assessment Module-Practical",
    credits: 11,
    maxIA: 50,
    maxSE: 50,
    marksIA: 20,
    marksSE: 22,
    percentage: "84%",
    grade: "A",
    gradePoint: 8,
    creditPoints: 88,
    result: "Pass",
  },
];

const NursingSemester2 = () => {
  const [studentId, setStudentId] = useState('');

  const [course, setCourse] = useState('');
  const [department, setDepartment] = useState('');
  const [year, setYear] = useState('');
  const [semester, setSemester] = useState('');
  const [submitted, setSubmitted] = useState(false);

  const handleSubmit = () => {
    if (!studentId ||  !course || !department || !year || !semester) {
      alert('Please fill all fields.');
      return;
    }
    setSubmitted(true);
  };

  return (
    <Box sx={{ px: 6, py: 4 }}>
      <Typography variant="h6" gutterBottom>
        Enter Student Details
      </Typography>



      <Button variant="contained" onClick={handleSubmit}>
        Show Memo
      </Button>

      {submitted && (
        <FormComponent4
          title="Second Semester B.Sc. Nursing Marks Memo 4YDC"
          subjectsData={subjectsData}
          idLabel="Student ID:"
          rollNumber={studentId}

          sod={department}
          examDate={`${year} - Semester ${semester}`}
          sgpa="8.9"
        />
      )}
    </Box>
  );
};

export default NursingSemester2;
